(4, 25, 'now i must go to comments section to rate a restaurant .. it will be better to enable this from restaurant page/or even dish page ..', 'rate the restaurant option', '2011-08-23 15:22:39', 1, 'Hey Bhargav, <br/> Thank you for your input! I have added a way for people to rate restaurants directly from the restaurant profile. Hover over rating on restaurant profile to see this widget in action. Thanks again.'),
(5, 0, 'This is a really good website with lots of information about NYC restaurants.', 'Great website', '2011-08-23 23:02:04', 1, 'Thank you! I am glad you liked it!  '),
(6, 0, 'It would be great if a group of people can vote on where they want to go for lunch/dinner etc...', 'Enhancement - Voting', '2011-08-24 15:43:09', 1, 'Great Suggestion! I''ll try to implement in later phases. Thank you.'),
(7, 0, 'Hey Akshay..so this is what kept you busy eh??\nGreat work bro!\nThe dishes look yummy !\nTake Care, \nShanu, Patna', 'Great Work !', '2011-08-26 04:53:32', 0, ''),
(8, 0, 'More reviews to come from me :)', 'you&#039;re awesome', '2011-09-07 19:51:03', 1, 'Thank you friend. Appreciate it. '),
