INSERT INTO `gdishes` (`id`, `name`, `description`, `cuisine_id`, `dishType`, `familyName`, `created`) VALUES
(3, 'Pork Chops', 'A pork chop is a cut of pork cut perpendicularly to the spine of the pig and usually containing a rib or part of a vertebra, served as an individual portion.', 87, 'Entre', 'Pork Chops', '2011-09-18 15:48:17'),
(6, 'Ddeokbokki ', 'Duk bokki is a very spicy and very popular Korean street food, and a favorite comfort food for Korean-American kids. It literally means <b>stir-fried rice cake</b>. When you buy from a street cart, itâ€™s usually just sliced rice cakes and fish cake in a sticky spicy sauce. But in the comfort of your kitchen, you have license to make it more elaborate. I personally love to make this dish with bacon (pork fat does rule) and as many vegetables as I can find. Play with the ingredients to suit your taste. It is also a great vegetarian option.', NULL, NULL, 'Rice Cake', '2011-09-18 15:48:17'),
(7, 'Chicken Wings', 'Chicken Wing is the wing section (drumette or flat) of chicken that is traditionally fried unbreaded and then coated in sauce.', NULL, NULL, 'Wings', '2011-09-18 15:48:17'),
(8, 'Noodles', '', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(9, 'Green Curry Fried Rice', 'Thai green curry spices blended in a hot green chili paste with bamboo shoots, basil, and bell peppers, simmered in coconut milk.', NULL, NULL, 'Fried Rice', '2011-09-18 15:48:17'),
(10, 'Chicken and Shrimp Dumplings', 'Dumplings are cooked balls of dough. They are based on flour, potatoes or bread, and may include meat, fish, vegetables, or sweets. They may be cooked by boiling, steaming, simmering, frying, or baking. They may have a filling, or there may be other ingredients mixed into the dough. Dumplings may be sweet or spicy. They can be eaten by themselves, in soups or stews, with gravy, or in any other way. While some dumplings resemble solid water boiled doughs, such as gnocchi, others such as wontons resemble meatballs with a thin dough covering.', NULL, NULL, 'Dumplings ', '2011-09-18 15:48:17'),
(11, 'Spicy Basil Noodles', 'Spicy Basil Noodles or Pad Kee Mao is a Chinese-influenced dish that was made popular by the Chinese people living in Laos and Thailand. It is a stir fried noodle dish very similar to Phat Si Io, but with a slightly different flavor profile. It is made with broad rice noodles, soy sauce, fish sauce, garlic, meat or tofu, bean sprouts, and various seasonings. Chili and basil give rise to its distinctive spiciness. Drunken fried rice or khao phat khimao is a similar dish.', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(12, 'Massaman Curry', 'Massaman Curry is a southern Thai dish that is Muslim in origin. It is most commonly made with beef, but can also be made with duck, tofu, chicken, or pork. <br/>\nThe flavoring for Massaman curry is called Massaman curry paste (nam phrik kaeng massaman). The dish usually contains coconut milk, roasted peanuts or cashews, potatoes, bay leaves, cardamom pods, cinnamon, star anise, palm sugar, fish sauce, and tamarind sauce.', NULL, NULL, 'Curry ', '2011-09-18 15:48:17'),
(13, 'Chicken Satay ', 'Chicken Satay is a dish of marinated, skewered and grilled chicken, served with a sauce. Satay may also consist of diced or sliced goat, mutton, beef, pork, fish, tofu, or other meats. The more authentic version uses skewers from the midrib of the coconut palm frond, although bamboo skewers are often used. These are grilled or barbecued over a wood or charcoal fire, then served with various spicy seasonings.', NULL, NULL, 'Satay', '2011-09-18 15:48:17'),
(14, 'Penang Curry', 'Penang Curry is a type of Thai curry that is milder than other Thai curries. It traditionally includes dried chili peppers, galangal, lemongrass, coriander root, coriander seeds, cumin seeds, garlic, and salt, and sometimes also shallots, peanuts, and shrimp paste. A popular phanaeng curry dish is beef phanaeng, which is a dish based on beef in a curry sauce. The traditional dish contains beef cut in thin strips, kaffir lime leaves, coconut milk, phanaeng curry paste, palm sugar and fish sauce. The dish typically contains thick coconut milk and will have very little other liquids added (hence a dry curry). For vegetarians, tofu can be used in place of beef.', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(15, 'Lard Na', 'Lard Na is a Lao-Chinese noodle dish covered in gravy that was made popular as a street food by the Chinese ethnics in Laos.\nThis dish is made with stir-fried wide rice noodles and either chicken, beef, pork, or tofu. The most common version includes vegetables such as Chinese gailan and straw mushrooms. However, broccoli is also commonly used if gailan is unavailable. Common seasonings include sweet soy sauce, fish sauce (nam pa), sugar, garlic, and black pepper.', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(16, 'Thai Stick ', 'Lemongrass-skewered chicken breast, mixed with bell peppers, mangoes, cilantro, basil, sesame, scallions, sambai, aioli and mango salsa served with steamed buckwheat noodles.', NULL, NULL, 'Skewers ', '2011-09-18 15:48:17'),
(17, 'Thai Fried Rice', 'Thai Fried Rice is a variety of Fried rice typical of central Thai cuisine. In Thai, khao means rice and pad means of or relating to being stir-fried. This dish differs from Chinese fried rice is that it is prepared with Thai Jasmine rice instead of regular long-grain rice. It normally contains a meat (chicken, shrimp, and crab are all common), egg, onions, and tomatoes. Green onions, coriander, and fried garlic are then mixed in. This dish has many regional variants, as it is a widespread dish. Then seasonings are stirred in, which may include soy sauce, sugar, salt, possibly some chili sauce, and the ubiquitous nam pla (fish sauce). Then the dish is plated and served with accompaniments like cucumber slices, tomato slices, lime and sprigs of green onion.', NULL, NULL, 'Fried Rice', '2011-09-18 15:48:17'),
(18, 'Pad Thai', 'Pad Thai is a dish of stir-fried rice noodles with eggs, fish sauce (Thai: à¸™à¹‰à¸³à¸›à¸¥à¸²), tamarind juice, red chilli pepper, plus any combination of bean sprouts, shrimp, chicken, or tofu, garnished with crushed peanuts, coriander and lime, the juice of which can be added along with Thai condiments. Pad Thai is one of Thailands national dishes.', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(19, 'Peanut Sauce', 'Peanut sauce, satay sauce, bumbu kacang, or sambal kacang is a sauce widely used in the cuisines of Indonesia, Malaysia, Thailand, Vietnam, China and Africa. It is also used, to a lesser extent, in European (particularly Dutch) and Middle Eastern cuisine.<br/>\nThe main ingredient is ground roasted peanuts, for which peanut butter can act as a substitute. Several different recipes for making peanut sauces exist, resulting in a variety of flavours. A typical recipe usually contains ground roasted peanuts or peanut butter (smooth or crunchy), coconut milk, soy sauce, galangal, garlic, and spices (such as coriander seed, cumin, etc). Other possible ingredients are chili peppers, sugar, milk, fried onions, and lemon grass.', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(20, 'Chicken Lollipop', 'Chicken lollipop is an hors dÅ“uvre that is made from the middle (and sometimes inner) segments of chicken wings. The middle segment has one of the two bones removed, and the flesh on the segments is pushed to one end of the bone. These are then coated in a spicy red batter and deep fried. It is also a popular item in Indian Chinese cuisine, served with Szechuan sauce.', NULL, NULL, 'Chicken Appetizer', '2011-09-18 15:48:17'),
(21, 'Manchurian ', 'Manchurian Chicken, consisting of chicken with vegetables in a spicy sauce. It is entirely a creation of Chinese restaurants in India, and bears little resemblance to traditional Chinese cuisine. It is said to have been invented in 1975 by Nelson Wang; Wang described his invention process as starting from the basic ingredients of an Indian dish, namely chopped garlic, ginger, and green chilis, but next, instead of adding garam masala, he put in soy sauce instead, followed by cornstarch and the chicken itself. A popular vegetarian variant replaces chicken with cauliflower.Other possibilities include prawn, fish, mutton, or paneer.', NULL, NULL, 'IndoChinese', '2011-09-18 15:48:17'),
(22, 'IndoChinese Fried Rice', 'IndoChinese Fried Rice, consisting of rice fried with vegetables in a spicy sauce. It is entirely a creation of Chinese restaurants in India, and bears little resemblance to traditional Chinese cuisine. It is a usually spicier than variants of fried rice from other cuisines. ', NULL, NULL, 'Fried Rice', '2011-09-18 15:48:17'),
(23, 'IndoChinese Chicken', 'Chicken prepared in a fusion (Indian and Chinese) style sauce. Basic Ingredients for this dish are from the Indian cuisines while some of the indian spices are substituted with sauces like soy and chili sauce.   ', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(24, 'IndoChinese Chow mein', 'Chow mein is a Chinese term for a dish of stir-fried noodles. IndoChinese Chow mein was  introduced by the Chinese of Calcutta. It is usually offered Hakka or with gravy. Catering to vegetarian diets, there is an Indian variant, vegetable chow mein, which consists of noodles with cabbage, bamboo shoots, pea pods, green peppers, and carrots. In the New Delhi area, chow mein can sometimes include paneer with the mixture of noodles and vegetables.', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(25, 'Fish Fingers', 'Fish Fingers or Fish Sticks in North America are made using whitefish such as cod, haddock or pollock which have been battered or breaded. ', NULL, NULL, 'Fish Appetizer ', '2011-09-18 15:48:17'),
(26, 'IndoChinese Corn Soup', 'IndoChinese Corn Soup comes from the Chinese of Calcutta, India. It contains ingredients like cream of corn, black pepper, corn four, sugar, egg whites and sesame seed oil. The popular variant comes with shredded or pieces of chicken. ', NULL, NULL, 'Soup', '2011-09-18 15:48:17'),
(27, 'Chilli Chicken ', 'One of the most popular dishes of the Indian Chinese cuisine, Chili chicken is cooked in a spicy sauce with ingredients from both Indian and Chinese cuisines. It is said to have been developed by the small Chinese community that has lived in Kolkata for over a century. It is also enjoyed by Indian and Chinese communities in Malaysia, Singapore and North America. ', NULL, NULL, 'IndoChinese', '2011-09-18 15:48:17'),
(28, 'Hakka Noodles', 'Hakka Noodles belongs to the Indo-Chinese cuisine; an immensely popular and widespread cuisine in India though it bears no resemblance to actual traditional Hakka or to any Chinese dishes. Noodles here are quickly stir fried with a spicy Indian Chinese flavored sauce and crunchy vegetables.<br/>\nThe ever popular Indian Chinese cuisine is the adaptation of Chinese seasoning/spices and cooking techniques to Indian tastes: tamarind combines with soy sauce, sugar with vinegar, Chinese spices are blended with cumin and coriander. Even the main ingredient in a dish is rarely of Chinese origin. The Indian cheese â€“ Paneer takes over the meaty dishes. Soy sauce, garlic, ginger, sesame, Asian sesame oil, scallions and fresh coriander are used in plenty. Deep fried, stir fried, dry or with gravy, fiery, sweet and sour, hot and sour, you name it  and you will find a dish to suit your taste.', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(29, 'Hot and Sour Soup', 'Hot and sour soup can refer to soups from several Asian culinary traditions. In all cases the soup contains ingredients to make it both spicy and sour.', NULL, NULL, 'Soup', '2011-09-18 15:48:17'),
(30, 'IndoChinese Chilli ', 'The lesser known variant of the highly popular Chilli Chicken, Chili Paneer is the choice of dish for vegetarians in the indoChinese Cuisine.  Cooked in a spicy sauce with ingredients from both Indian and Chinese cuisines. It is said to have been developed by the small Chinese community that has lived in Kolkata for over a century. It is also enjoyed by Indian and Chinese communities in Malaysia, Singapore and North America. ', NULL, NULL, 'IndoChinese', '2011-09-18 15:48:17'),
(31, 'Paneer Pakora', 'Paneer Pakora is created by taking paneer and dipping them in a batter of gram flour and then deep frying them. <br/>\nIn Southern States of India, such a preparations are known as bajji rather than pakoda. ', NULL, NULL, 'Snacks', '2011-09-18 15:48:17'),
(32, 'Fried Chicken Chunks', 'Pieces of Chicken Deep fried with spices or batter. ', NULL, NULL, 'Chicken Appetizer', '2011-09-18 15:48:17'),
(33, 'Bubble Tea', 'Bubble tea is the popular Americanized name for pearl milk tea and other similar tea and juice beverages that originated in tea shops in Taichung, Taiwan in the 1980s. Drink recipes may vary, but most bubble teas contain a tea base mixed with fruit (or fruit syrup) and/or milk. Ice-blended versions of the drinks, similar to slushies, are also available, usually in fruit flavors.<br/>\nOne of famous categories of bubble teas is pearl milk tea (also known as boba milk tea), which contains small chewy balls made of tapioca starch, called "Pearls" in Chinese (also known as Fenyuan or Boba (Poba)). Pearls made of jelly are also available in many places.', NULL, NULL, 'Tea/Coffee ', '2011-09-18 15:48:17'),
(34, 'Pork Dumpling', 'Dumplings are cooked balls of dough. They are based on flour, potatoes or bread, and may include meat, fish, vegetables, or sweets. They may be cooked by boiling, steaming, simmering, frying, or baking. They may have a filling, or there may be other ingredients mixed into the dough. Dumplings may be sweet or spicy. They can be eaten by themselves, in soups or stews, with gravy, or in any other way. While some dumplings resemble solid water boiled doughs, such as gnocchi, others such as wontons resemble meatballs with a thin dough covering.', NULL, NULL, 'Dumplings', '2011-09-18 15:48:17'),
(35, 'Green Tea Noodles', 'Green Tea noodles are Soba noodles made of buckwheat flour (soba-ko) and wheat flour (komugi-ko) with the added ingredient of fresh Green Tea leaves (Ryokucha or Ocha).  In Japan Cha Soba is considered a delicacy and is only consumed on very special occasions.<br/>\n\nGreen Tea is considered by many to have many significant health benefits including high levels of antioxidants, polyphenols, theanine, as well as a wide variety of vitamins and minerals', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(36, 'Taiwanese Appetizer', 'Sampler dish consisting of chickens, deep fried shrimp balls, tea eggs.', NULL, NULL, 'Snacks', '2011-09-18 15:48:17'),
(37, 'Taiwanese Hot Pot', 'Hot pot, less commonly Chinese fondue or steamboat, refers to several East Asian varieties of stew, consisting of a simmering metal pot of stock at the center of the dining table. While the hot pot is kept simmering, ingredients are placed into the pot and are cooked at the table. Typical hot pot dishes include thinly sliced meat, leafy vegetables, mushrooms, wontons, egg dumplings, and seafood. The cooked food is usually eaten with a dipping sauce. In many areas, hot pot meals are often eaten in the winter.', NULL, NULL, 'Hot Pot ', '2011-09-18 15:48:17'),
(38, 'Slushy', 'Conventional slush drinks, typified by the Magic Slush (real fruits) or Slush Puppie, use a single slurry made by freezing a sweetened base, similar to apple juice. This slurry is mixed at serving time with a flavouring syrup of the buyers choice. These drinks are notable in that the flavored syrup can be drawn out of the drink, leaving a relatively-unflavoured base ice behind.', NULL, NULL, 'Cold Drinks', '2011-09-18 15:48:17'),
(39, 'Fish Paste', 'A paste made from fresh fish that has been minced and pulverized such that it gains a rubbery texture when cooked. A common food product in East Asian cuisines. Also called Surimi. ', NULL, NULL, 'Fish', '2011-09-18 15:48:17'),
(40, 'HongKong Noodles', 'Hong Kong noodles are egg and wheat-flour noodles used to make chow mein.', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(41, 'Ramen', 'Ramen is a Japanese noodle dish. It consists of Chinese-style wheat noodles served in a meat- or fish-based broth, often flavored with soy sauce or miso, and uses toppings such as sliced pork, dried seaweed, kamaboko, green onions, and occasionally corn. Almost every locality in Japan has its own variation of ramen, from the tonkotsu (pork bone broth) ramen of Kyushu to the miso ramen of Hokkaido.', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(42, 'Milkshake', 'Milkshake is a sweet, cold beverage which is made from milk, ice cream or iced milk, and flavorings or sweeteners such as fruit syrup or chocolate sauce.<br/>\nFull-service restaurants, soda fountains, and diners usually prepare and mix the shake "by hand" from scoops of ice cream and milk in a blender or drink mixer using a stainless steel cup. Most fast food outlets do not make shakes by hand with ice cream. Instead, they make shakes in automatic milkshake machines which freeze and serve a premade milkshake mixture consisting of milk, a sweetened flavoring agent, and a thickening agent.', NULL, NULL, 'Cold Drinks', '2011-09-18 15:48:17'),
(43, 'Milk Tea', 'Tea boiled with milk, water and sugar. ', NULL, NULL, 'Tea/Coffee', '2011-09-18 15:48:17'),
(44, 'Dal Makhni', 'A treasured staple food, originally from the Punjab in India. This dish is a type of dal (boiled lentils or other dried legumes or pulse). As well as with roti or rice, it is also commonly eaten with either naan or chapatis.', NULL, NULL, 'Lentil Soup', '2011-09-18 15:48:17'),
(45, 'Shami Kebab', 'A popular Indian and Pakistani kebab, that is composed of small patty minced mutton or beef, ground chickpeas and spices.\nShami kebabs are an extremely popular snack in India and Pakistan. They are often garnished with lemon juice and/or sliced raw onions, and are usually eaten with chutney made from mint or coriander. They are also served along with Sheer Khurma on Muslim Eid Days. <br/>\nA variation of Shami kebab is also found in the Bangladeshi cuisine. The recipe is almost the same but it tastes different from the original version. Beef Shami kebab is the most popular.', NULL, NULL, 'Kebab', '2011-09-18 15:48:17'),
(46, 'Bhel Puri ', 'Bhel Puri is a puffed rice dish with various vegetables and a tangy tamarind sauce. It is a type of chaat, or small plates of savoury snacks, particularly identified with the beaches of Mumbai (Bombay), such as Chowpatty. Bhelpuri is called Jhaal Muri in Kolkata (meaning hot puffed rice). A native Mysore variant of Bhelpuri is known as Churumuri in Bangalore.', NULL, NULL, 'Indian Snacks ', '2011-09-18 15:48:17'),
(47, 'Sooley', 'Grilled lamb marinated in lemon and garlic on a bamboo skewer', NULL, NULL, 'Skewer ', '2011-09-18 15:48:17'),
(48, 'Tandoori ', 'Tandoori is a highly popular Indian and South Asian dish consisting of roasted Chicken/Paneer/Meat in yogurt, and spices.<br/>\nThe item is marinated in curd and seasoned with tandoori masala. It is moderately hot, but the heat is reduced in most Western nations. Cayenne pepper, red chili powder or kashmiri red chilli powder is used to give it a fiery red hue. A higher amount of Turmeric produces an orange color. In some modern versions, both red and yellow food coloring are used. It is traditionally cooked at high temperatures in a tandoor (clay oven), but can also be prepared on a traditional barbecue grill.', NULL, NULL, 'Tandoori', '2011-09-18 15:48:17'),
(49, 'Kashmiri Murgh', 'Boneless chicken flavored with coriander and aromatic Indian spices, yogurt sauce', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(50, 'Chatpata Murgh', 'Grilled chicken breast marinated in lemon and tandoori spices with mint-strawberry-jalapeÃ±o sauce', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(51, 'Biryani', 'Biryani is a set of rice-based foods made with spices, rice (usually basmati) and meat, fish, eggs or vegetables. The name is derived from the Persian word beryÄ(n) which means fried or roasted.<br/>\nThe Biryani originated in the South Asia in the kitchens of Muslim rulers. Biryani is popular not only in South Asia but also in Arabia and within various South Asian communities in Western countries. The dish has many local variants.', NULL, NULL, 'Fried Rice', '2011-09-18 15:48:17'),
(52, 'Aaloo Tikiyas', 'Aloo tikki is a North Indian snack made of boiled potatoes and various spices. Aloo means potato, and the word tikki means a small cutlet or croquette. Found in almost every chaat shop or stall all over Delhi other parts of India. It is served hot along with Saunth, tamarind and coriander-mint chutney (sauce), known as Hari chutney, and sometimes yogurt or chick peas.\nIn Mumbai, a popular version is aloo tikki served with a spicy curry and various chutneys. It is called Ragda pattice and is sold on the various chaat stalls throughout the city and especially the Chowpatti Beach.<br/>\nAloo tikki is basically mashed potato patties mixed with various herbs, like coriander and spices, deep-fried in oil/vanaspati, and some North Indian dhabas or cafÃ©-style eateries will sandwich the aloo with bread.', NULL, NULL, 'Snacks', '2011-09-18 15:48:17'),
(53, 'Fish Koliwada', 'Fish Koliwada is an appetizer which has its origin in the coastal city of MumbaiPunjabi migrants from Pakistan settled around Sion Koliwada, who started this unique style of simple yet packed with flavors, fried fish which today is known all over as Fish Koliwada.', NULL, NULL, 'Fish Appetizer ', '2011-09-18 15:48:17'),
(54, 'Korma', 'Korma (sometimes spelled kormaa, qorma, kavurma, khorma, or kurma) is a dish originating in South Asia or Central Asia which can be made with yogurt, cream, nut and seed pastes or coconut milk. It is usually considered a type of curry. Both vegetarian and non-vegetarian kormas exist.', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(55, 'Potato Curry ', '', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(56, 'Makhani (Butter Masala)', 'Makhani is a Hindi/Punjabi word meaning - <i>with butter</i>. This Curry comes in vegetarian or non-vegetarian varieties. Most popular are Chicken Butter Masala and Paneer Butter Masala. ', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(57, 'Tikka Masala', 'Tikka Masala, is a curry dish of roasted chicken chunks (can be substituted with Indian Cheese [<i>Paneer</i>] or other meats) served in a rich-tasting red or orange-coloured sauce. The sauce is usually creamy, lightly spiced and contains tomatoes. Tikka masala has been found to be the most popular dish in British restaurants.\nThe origins of Tikka Masala are disputed. An expert on street food declared that the dish originated in Punjab during the last 50 years. Another view is that it originated in the first Indian restaurants in Soho, London, typically owned by Bangladeshi Britons during the 1960s. ', NULL, NULL, 'Curry ', '2011-09-18 15:48:17'),
(58, 'Indian Bread', 'Please provide a description. ', NULL, NULL, 'Bread', '2011-09-18 15:48:17'),
(59, 'Dal', 'Dal (also spelled Dahl or Daal, or Dhal) is a preparation of pulses (dried lentils, peas or beans) which have been stripped of their outer hulls and split. It also refers to the thick stew prepared from these, an important part of Indian, Nepali, Pakistani, Sri Lankan, and Bangladeshi cuisine. It is regularly eaten with rice and vegetables in Southern India, and with both rice and roti (wheat-based flat bread) throughout Northern India and Pakistan. Dal is a ready source of proteins for a balanced diet containing little or no meat. Sri Lankan cooking of dal resembles that of southern Indian dishes.', NULL, NULL, 'Lentil Soup', '2011-09-18 15:48:17'),
(60, 'Samosa', 'A samosa is a stuffed pastry and a popular snack in South Asia, Southeast Asia, Central Asia, the Arabian Peninsula, the Mediterranean, Southwest Asia, the Horn of Africa, North Africa and South Africa. It generally consists of a fried or baked triangular, semi-lunar or tetrahedral pastry shell with a savory filling, which may include spiced potatoes, onions, peas, coriander, and lentils, or ground beef or chicken. The size and shape of a samosa as well as the consistency of the pastry used can vary considerably, although it is mostly triangular. Samosas are often served with chutney', NULL, NULL, 'Indian Snacks', '2011-09-18 15:48:17'),
(61, 'Chicken Curry', 'Curry Chicken is a common Indian cuisine dish popular in South Asia (specifically Pakistan & India), Bangladesh, East Asia, as well as in the UK, Canada and the Caribbean. A typical curry consists of chicken in an onion, tomato, and yogurt-based sauce, flavoured with ginger, garlic, chillies and a variety of spices, often including cumin, cinnamon, cardamom. Curry Chicken is sometimes made with pre-made curry powder. Milk is sometimes added to decrease the spiciness.', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(62, 'Shaahi Paneer', 'Shaahi paneer (Devanagari à¤¶à¤¾à¤¹à¥€ à¤ªà¤¨à¥€à¤°) is a preparation of paneer (Indian Cheese), cream, tomatoes and spices. Thick, creamy and spicy, it is a mainstay of Indian cuisine.<br/>\nShaahi Paneer is immensely popular, especially in North India. It is typically eaten with Roti, Chappati or other Indian breads. Paneer is the Indian word for cottage cheese, and Shahi is the Indo-Persian term for royal (in reference to the Mughal court).', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(63, 'Roti Canai', 'Roti canai (pronounced "chanai," not "kanai") is a type of flatbread found in Malaysia, often sold in Mamak stalls. It is known as roti prata in Southern Malaysia and Singapore, and is similar to the Indian Kerala porotta.', NULL, NULL, 'Snacks', '2011-09-18 15:48:17'),
(64, 'Hummus', 'Dip or spread made from cooked, mashed chickpeas, blended with tahini, olive oil, lemon juice, salt and garlic. It is a popular food throughout the Middle East and elsewhere. It is served with flatbread (such as pita) or as an accompaniment to falafel, grilled chicken, fish or eggplant.   ', NULL, NULL, 'Dip or Spread', '2011-09-18 15:48:17'),
(65, 'Turkish Dumpling', 'Type of dumpling in Turkish, various Central Asian and Northwest Chinese cuisines. Consists of a spiced meat mixture, usually lamb or ground beef, in a dough wrapper, either boiled or steamed.', NULL, NULL, 'Dumpling', '2011-09-18 15:48:17'),
(66, 'Vegetable Dumplings', 'Dumplings are cooked balls of dough. They are based on flour, potatoes or bread, and may include meat, fish, vegetables, or sweets. They may be cooked by boiling, steaming, simmering, frying, or baking. They may have a filling, or there may be other ingredients mixed into the dough. Dumplings may be sweet or spicy. They can be eaten by themselves, in soups or stews, with gravy, or in any other way. While some dumplings resemble solid water boiled doughs, such as gnocchi, others such as wontons resemble meatballs with a thin dough covering.', NULL, NULL, 'Dumplings', '2011-09-18 15:48:17'),
(67, 'Pad kee Mao', '<b>Drunken noodles</b> (or Pad Kee Mao) is a Chinese-influenced dish that was made popular by the Chinese people living in Laos and Thailand. It is a stir fried noodle dish very similar to Phat Si Io, but with a slightly different flavor profile. It is made with broad rice noodles, soy sauce, fish sauce, garlic, meat or tofu, bean sprouts, and various seasonings. Chili and basil give rise to its distinctive spiciness. Drunken fried rice or khao phat khimao is a similar dish.', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(68, 'Pad See Ew', '<b>Phat Si Io</b> (also, Pad See Ew or Pad Si Ew) is a Chinese-influenced stir fried noodle dish that is commonly eaten as street food in Laos and Thailand. It is also quite popular in Lao and Thai restaurants around the world.\nThe literal meaning is fried (with) soy sauce and it is very similar to the char kway teow of Singapore and Malaysia. Phat Si Io is normally dry stir fry while the other similar dish, Lard Na (in Laos) or Rad Na (in Thai), is topped with gravy and generally has lighter taste.<br/>\nIt is made with dark soy sauce (si-io dam), light soy sauce (si-io khao), garlic, broad rice noodles, called <i>kuai-tiao sen yai</i> in Thai (commonly abbreviated to just <i>sen yai</i> meaning big strip), Chinese broccoli, egg, and some form of thinly sliced meat â€” commonly pork, chicken or beef â€” or shrimp or mixed seafood. The name comes from the soy sauce used in the dish, which is called si-io, or <i>si-io</i> sauce, a loanword from Teochew. Phadt Si Io is sometimes called <i>kuai tiao pad si ew</i> which reflects the general practice of using flat rice noodle as the main ingredient. However, other types of noodles can also be found.', NULL, NULL, 'Noodles', '2011-09-18 15:48:17'),
(69, 'Red Curry', 'Red curry (lit: spicy soup) is a popular Thai dish consisting of curry paste to which coconut milk is added. The base is properly made with a mortar and pestle, and remains moist throughout the preparation process. The main ingredients are garlic, shallots, (dried) red chillies, galangal, shrimp paste, salt, kaffir lime peel, coriander root, coriander seeds, cumin seeds, peppercorns and lemongrass. Common additives are fish sauce, sugar, Thai eggplant, bamboo shoots, thai basil (bai horapha), and meat such as chicken, beef, pork, shrimp, frog, snake or duck. Tofu, and meat analogues or vegetables such as pumpkin, can be substituted as a vegetarian option. This dish normally has a soup-like consistency and is served in a bowl and eaten with steamed rice. The standard red curry paste contains shrimp paste, which renders it inappropriate for vegetarians. There are, however, vegetarian red curry pastes available.\n<br/>\nSome of the ingredients for the paste\nRed curry paste itself is the core flavouring for a number of other non-related dishes such Thot man pla (fish cakes) and sai ua (grilled Chiang Mai sausage).', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(70, 'Tod Mun', 'In Thai cuisine the fish is first mashed and then mixed with chopped yardlong beans, fresh coriander (including stalks), fish sauce, kaffir lime leaves, red curry paste, and an egg binding. It is deep fried and usually served with a sweet chilli dipping sauce. Thot man pla have become popular around the world.', NULL, NULL, 'Fish Cake', '2011-09-18 15:48:17'),
(71, 'Yellow Curry', 'Yellow curry is one of three major kinds of Thai curry, commonly found in Thai restaurants in the West. There are many more types in Thailand, several of which are yellow. Pre-packaged curry powder of Indian origin is sometimes also referred to as yellow curry in Western countries but is a different blend of spices than Thai yellow curry.\nThai Yellow curry, outside Thailand, usually refers to kaeng kari. This curry is richer and creamier than other Thai curries, since coconut cream is used in addition to coconut milk. This richer curry tends to tone down the overall spiciness of the dish, hence its popularity on menus outside of Thailand. The primary spices in kaeng kari are cumin, coriander, turmeric, fenugreek, garlic, salt, bay leaf, lemongrass, cayenne pepper, ginger, mace and cinnamon. Sometimes a touch of palm sugar or a similar sweetener will be added, depending on the sweetness of the coconut milk.\nThere is also <i>kaeng lueang</i>, which directly translated means yellow curry in Thai. This is often a lighter color than kaeng kari (which is almost a peanut butter color) but spicier and sharper.\nThai yellow curry can be made with duck, chicken, shrimp, fish or vegetables and is eaten with rice or round rice noodles known as khanom chin.', NULL, NULL, 'Curry', '2011-09-18 15:48:17'),
(72, 'Pad-Noh-Mai', 'Pad-Noh-Mai consists of sautÃ©ed minced chicken, fresh basil, chili, bamboo shoots, and garlic. Served with rice generally, and is a spicy dish.', NULL, NULL, 'Thai', '2011-09-18 15:48:17'),
(73, 'Crispy Glazed Sweet Potato', 'Crispy Glazed Sweet Potato is an appetizer that has sweet potatoes with  a crunchy outer shell and creamy interior, glazed in a sweet syrup and sprinkled with toasty sesame seeds.', NULL, NULL, 'Appetizer', '2011-09-18 15:48:17'),
(74, 'Pineapple Shortcakes', 'Pineapple shortcakes are square-shaped and filled with pineapple paste.', NULL, NULL, 'Dessert', '2011-09-18 15:48:17'),
(75, 'Black Pepper Chicken', 'Black Pepper Chicken consists of deep fried chicken pieces in spicy black pepper sauce, generally served with rice.  ', NULL, NULL, 'Asian Chicken', '2011-09-18 15:48:17'),
(76, 'Avocado Rolls', 'Avocado rolls are a type of sushi made with avocado inside.  ', NULL, NULL, 'Sushi', '2011-09-18 15:48:17'),
(77, 'Singapore Noodles', 'Singapore noodles is a dish of stir-fried rice vermicelli seasoned with curry powder, bean sprouts, soy sauce, and sliced chillies or peppers. It is served as a vegetarian dish or can be accompanied by small slices of chicken, beef or shrimp. It is actually not a cultural product of Singapore and is virtually non-existent there. Its naming may have been based on the stereotype that Singapore cuisine is generally spicy, and might have originated from an enterprising restaurateur eager to add a dash of exoticism to his menu. ', NULL, NULL, 'Noodle', '2011-09-18 15:48:17'),
(78, 'Steak', 'A steak (from Old Norse steik, <i>roast</i>) is a cut of meat (usually beef). Most are cut perpendicular to the muscle fibres, improving the perceived tenderness of the meat. In North America, steaks are typically served grilled, pan-fried, or broiled. The more tender cuts from the loin and rib are cooked quickly, using dry heat, and served whole. Less tender cuts from the chuck or round are cooked with moist heat or are mechanically tenderized.', NULL, NULL, 'Steak', '2011-09-21 01:37:53'),
(79, 'Tempura', 'Tempura is a Japanese dish of seafood or vegetables that have been battered and deep fried. Tempura was introduced to Japan in the mid-sixteenth century by Portuguese Jesuits. The word "tempura", or the technique of dipping fish and vegetables into a batter and frying them, comes from the word "tempora", a Latin word meaning "times", "time period" used by both Spanish and Portuguese missionaries to refer to the Lenten period or Ember Days, Fridays, and other Christian holy days. Ember Days refer to holy days when Catholics avoid meat and instead eat fish or vegetables.  ', NULL, NULL, 'Asian Appetizer', '2011-09-27 23:06:06'),
(80, 'Sushi', 'Platter of spicy salmon sushi and sashimi.', NULL, NULL, 'Sushi', '2011-09-27 23:10:52'),
(81, 'Bacon and Egg Sandwich', 'Bacon and Egg sandwich is a simple sandwich with bacon, eggs, mayo, buttered or toasted bread. ', NULL, NULL, 'Sandwich', '2011-09-27 23:14:59'),
(82, 'Spaghetti', 'Spaghetti is a long, thin, cylindrical pasta of Italian origin. Spaghetti is made of semolina or flour and water. Italian dried spaghetti is made from durum wheat semolina, but outside of Italy it may be made with other kinds of flour. Generally served with tomato sauce, vegetables or meat, or cheese.', NULL, NULL, 'Pasta', '2011-09-27 23:36:34'),
(83, 'Custard', 'Custard is a variety of culinary preparations based on a cooked mixture of milk or cream and egg yolk. Depending on how much egg or thickener is used, custard may vary in consistency from a thin pouring sauce to a thick pastry cream used to fill Ã©clairs. The most common custards are used as desserts or dessert sauces and typically include sugar and vanilla. ', NULL, NULL, 'Dessert', '2011-09-27 23:41:51'),
(84, 'Egg Sandwich', 'An egg sandwich is a sandwich with some kind of egg filling, which could include sliced boiled eggs, egg salad, fried eggs or and scrambled eggs. ', NULL, NULL, 'Sandwich', '2011-09-27 23:44:15'),
(85, 'Macaroni', 'Macaroni is a variety of moderately extended, machine-made, dry pasta made with durum wheat. Macaroni noodles do not contain eggs, and are normally cut in short, hollow shapes; however, the term refers not to the shape of the pasta, but to the kind of dough from which the noodle is made. A common preparation includes macaroni with cheese. In areas with large Chinese populations open to Western cultural influence, such as Hong Kong, Macao, Malaysia and Singapore, the local Chinese have adopted macaroni as an ingredient for Chinese-style Western cuisine. Macaroni is cooked in water and then washed of starch, and served in clear broth with ham or frankfurter sausages, peas, black mushrooms, and optionally eggs, reminiscent of noodle soup dishes.  ', NULL, NULL, 'Pasta', '2011-09-27 23:49:44'),
(86, 'Steamed Sweet Bread', 'Steamed Sweet Bread is a type of steamed, filled bun or bread-like item in various Chinese cuisines, as there is much variation as to the fillings and the preparations. In its bun-like aspect it is very similar to the traditional Chinese mantou. It can be filled with meat and/or vegetarian fillings.', NULL, NULL, 'Bread', '2011-09-27 23:52:35'),
(87, 'Fried Sweet Bread', 'Fried Sweet bread', NULL, NULL, 'Bread', '2011-09-27 23:55:43'),
(88, 'Tuna Sandwich', 'A tuna fish sandwich, a tuna salad sandwich, or tuna sandwich, is a type of sandwich usually made with tuna salad and includes ingredients such as mayonnaise, celery, hard-boiled egg, pickle, onions, black olives. ', NULL, NULL, 'Sandwich', '2011-09-27 23:58:28'),
(89, 'Portuguese Style Chicken', 'Portuguese style chicken is barbecued chicken coated with spicy piri piri sauce and cheese.', NULL, NULL, 'Chicken', '2011-09-28 00:06:02'),
(90, 'Green Curry', 'Green curry is a variety of curry in Thai cuisine. The name <b>green</b> curry derives from the color of the dish. Other Thai curry dishes are identified solely by their colors, such as yellow and red curry. Green curries tend to be as hot as red curries, both being hotter than phanang/padang curries. However, green curries, regardless of heat, have a definite and desired sweetness that is not usually associated with red curries.<br/>\nThe main ingredients for the sauce consist of coconut milk, green curry paste, aubergine, pea aubergine, sugar, fish sauce, kaffir lime leaves, and Thai basil leaves. The consistency of its sauce varies with the amount of coconut milk used. Green curry paste is made by pounding in a mortar green chillies, shallots, garlic, galangal, kaffir lime peel, roasted coriander and cumin seeds, white peppercorns, shrimp paste and salt. The paste is briefly fried in split coconut cream, then coconut milk, meat or fish, and vegetables added along with a pinch of palm sugar. Finally, kaffir lime leaves, <i>phrik chi fa</i> (sky-pointing chilies, large mild chilies) and Thai basil are added just at the end of cooking for fragrance. When the curry is made with fish or seafood, krachai (wild ginger, Chinese keys) is added. Thai green curry can be made using readily available commercially made curry paste.<br/>\nThai green curry can be made with all kinds of meat. However, the more popular ones are made with beef, pork, chicken, and fish ball. ', NULL, NULL, 'Curry', '2011-10-05 01:28:13'),
(91, 'Milagai podi Dosa', 'Molagai Podi (literally chilli powder in Tamil) is a coarse mixture of ground dry spices that typically contains dried chillies, lentils, and sesame seeds. Tamils traditionally use milagai podi as a condiment on idlis, dosas and other South Indian dishes. The intensity of this condiments spiciness can range from almost no spice at all to extremely spicy. Some like to sprinkle a layer of sugar on top of the spicier mixtures after the oil is poured on the powder. This innovative idea creates a barrage of flavors once inside the mouth, from spicy and salty to sweet. Parents use this method for satisfying children who crave <i>podi</i> but can not handle the intense flavor.<br/>\nConsidered a convenient substitute to chutneys, it is usually available in most households in Tamil Nadu.\n<b>Molagai podi</b> is not consumed dry, rather it is mixed with sesame oil or sometimes ghee.', NULL, NULL, 'Dosa', '2011-10-05 01:37:07'),
(92, 'Paper Dosa', '<b>Dosa</b> or <b>Dhosai</b> is a fermented crepe or pancake made from rice batter and black lentils. It is indigenous to and is a staple dish in the southern Indian states of Andhra Pradesh, Karnataka, Kerala, and Tamil Nadu, as well as being popular in Sri Lanka. Dosa is also popular in Malaysia and Singapore, where the name <i>Thosai</i> is more common, and in Myanmar as <i>Toshay</i>.<br/>\nPaper dosa is a variety of dasa characterized by a long and very thin delicate dosa which can be spread over 2 feet.', NULL, NULL, 'Dosa', '2011-10-05 01:40:57'),
(93, 'Sada Dosa', '<b>Dosa</b> or <b>Dhosai</b> is a fermented crepe or pancake made from rice batter and black lentils. It is indigenous to and is a staple dish in the southern Indian states of Andhra Pradesh, Karnataka, Kerala, and Tamil Nadu, as well as being popular in Sri Lanka. Dosa is also popular in Malaysia and Singapore, where the name <i>Thosai</i> is more common, and in Myanmar as <i>Toshay</i>.<br/>\nSada dosa is a variety of dosa characterized by a simple crepe with no stuffings. ', NULL, NULL, 'Dosa', '2011-10-05 01:43:29'),
(94, 'Masala Dosa', '<b>Dosa</b> or <b>Dhosai</b> is a fermented crepe or pancake made from rice batter and black lentils. It is indigenous to and is a staple dish in the southern Indian states of Andhra Pradesh, Karnataka, Kerala, and Tamil Nadu, as well as being popular in Sri Lanka. Dosa is also popular in Malaysia and Singapore, where the name <i>Thosai</i> is more common, and in Myanmar as <i>Toshay</i>.<br/>\nA masala dosa is made by stuffing a dosa with a lightly cooked filling of potatoes, fried onions and spices. It wraps the dosa around an onion and potato curry or sabji.', NULL, NULL, 'Dosa', '2011-10-05 01:44:29');
