INSERT INTO `reviews` (`id`, `user_id`, `restaurant_id`, `created`, `rating`, `title`, `comment`) VALUES
(5, 6, 37, '2011-08-08 21:59:26', 4, 'Huge quantity for lunch!', 'The lunch buffet at Chola allows one to carry away food for two days! literally! Chola also sports a nice selection of Indian dishes for dinner.\n\n '),
(6, 6, 40, '2011-08-08 23:12:06', 4, 'Surprisingly good! ', 'Even though East Village Thai is a tiny place hidden away on 7th street, The food is absolutely delicious. Try Pad Krow Pow or Pad Thai... yummy!\n\n'),
(7, 24, 3, '2011-08-10 15:28:55', 5, '', 'The Tangra masala fried rice is delicious! It is my favorite dish at this place. Paneer chilli, dry or with gravy, is also very good. Most of the food here gives a good flavor of Indian-Chinese food. Highly Recommend.\n'),
(8, 24, 25, '2011-08-10 19:15:57', 4, '', 'This place has really good curries and vegetarian options too. I have tried the Yellow curry with the vegetarian duck the most and it is delicious. Even their mild spice level is pretty spicy.\n'),
(9, 24, 24, '2011-08-10 19:20:43', 4, '', 'One of the very few good Indian restaurants in NYC.\n '),
(10, 24, 32, '2011-08-10 19:25:56', 2, '', 'Food is pretty standard, nothing extraordinary to speak about.\n  '),
(11, 24, 22, '2011-08-10 19:26:51', 2, '', 'Food is alright, found the chilli paneer bland and boring.\n'),
(18, 20, 4, '2011-08-14 22:30:49', 4, 'A Great place for hangout!', 'I have been going to Saint Alps Tea House for over 5 years now. The bubble tea is refreshing, snacks are delicious and atmosphere is great. Service is quick but they dont pressure you into leaving which means you can enjoy the atmosphere for as long as you want. Awesome Place!\n'),
(17, 6, 24, '2011-08-10 23:03:43', 4, 'Good Indian Food, fine dining...', 'Although a bit expensive, food at tamarind is really good. It comes close to authentic Indian flavors and the service is great aswell. Definitely recommended!\n'),
(19, 20, 3, '2011-08-14 22:48:00', 3, 'Closest to the taste from back home...', 'I have tried Indian Chinese cuisines at a bunch of restaurants in the city. But Tangra masala comes the closest to tasting as good as authentic Indian Chinese. I really like a lot of dishes here! \n'),
(20, 25, 4, '2011-08-23 15:28:55', 3, 'awesome place', 'must try'),
(21, 25, 58, '2011-08-23 15:32:38', 3, 'must try singapore mei fan', 'good dish .. lots of \nquantity'),
(22, 6, 58, '2011-08-24 03:33:01', 3, 'NONE', 'Just Rating'),
(23, 6, 58, '2011-08-24 03:33:13', 3, 'NONE', 'Just Rating'),
