(29, 6, 53, '2011-08-24 23:50:24', 3, 'Good Option for Thai food in midtown.', 'Been here a few times now. Food is good. They make it spicy if you ask them to. Pad kee moa is really good here.'),
(30, 6, 36, '2011-08-25 02:27:24', 2, 'NONE', 'Just Rating'),
(31, 6, 28, '2011-08-25 23:47:23', 4, 'Best Place in the city for Afghan food!', 'Really liked this place. Must try.'),
