(36, 24, 66, '2011-09-09 03:40:34', 3, 'Chocolate Lover&#039;s Delight', 'Love the waffle fries and a couple of chocolate cake desserts. But some of the dishes are too much of a chocolate overdose for me.'),
(37, 24, 64, '2011-09-09 03:43:22', 3, 'Good Food', 'Went to the Jackson Heights location and enjoyed the food. More of an Indian influence than Chinese on many dishes.'),
