(48, 6, 82, '2011-10-02 23:50:01', 2, 'Good Food, Bad Service!', 'The dosas we ordered tasted really good. But the service was so bad that it ruined our experience. The waiters were arrogant and confused. Bar is just nominal. None of them know how to make drinks. They made us wait 30 minutes for our takeout order (after a sit down meal) and then just gave us cash back for the dish.'),
