(50, 6, 60, '2011-10-03 19:17:52', 4, 'Tater tots are so good!', 'Amazing tater tots! also try their coffee milkshake. really good.'),
(51, 6, 79, '2011-10-03 19:21:34', 4, 'good service, good food, good drinks, great experience!', 'Smith has a great atmosphere! Every time I&#039;ve been here, experience was good. They have really good breakfast options as well.');
